import React from 'react';
import './App.css';

import About from './components/About';
import Landing from './components/Landing';
import Footer from './components/Footer';

import { Router } from '@reach/router';

function App() {
	return (
		<div className="App">
			<Router>
				<Landing path="/" />
				<About path="/about" />
			</Router>
			<Footer />
		</div>
	);
}

export default App;
